import logo from './logo.svg';
import './App.css';
import Header from "./components/Header";
  import Footer from "./components/Footer";
  import Note from "./components/Note";

  const express = require("express");
const https = require("https");
const http = require("http");
const bodyParser = require("body-parser");
const app = express();
app.use(bodyParser.urlencoded({
  extended: true
}));


app.get("/", function(req, res) {
  res.sendFile(__dirname + "/index.html");
});

app.get("/jobs/1", function(req, res) {
  const url = "http://localhost:8080/jobs/1";
  http.get(url, function(response) {
    response.on("data", function(data) {
      res.write(data);
      res.send();
    });

  });
});


function App() {
  return (
    <div className="App">
      {/* <header className="App-header"> */}
      <header>
      <Header/>
      <Note header="Jobs Queue" content="Queued" img="queue.png"/>
      <Note header="Jobs Running" content="Running" img="running.png"/>
      <Note header="Jobs Finished" content="Successful" img="success.png"/>
      <Note header="Jobs Finished" content="Failed" img="failure.png"/>
      <Footer/>

      </header>
    </div>
  );
}

export default App;
